prediction.sparql:
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?person ?personLabel ?dod ?archives ?archivesLabel WHERE {
  VALUES ?dept {
    wd:Q3240
  }
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 ; wdt:P570 ?dod .
  FILTER ( ?dod < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 / wdt:P131 * ?dept .
  } UNION {
    ?person wdt:P20 / wdt:P131 * ?dept .
  }
  OPTIONAL {
    ?person wdt:P485 ?archives .
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?archives rdfs:label ?archivesLabel .
    FILTER ( LANG( ?archivesLabel ) = "en" )
  }
}
ORDER BY ?personLabel
LIMIT 1000

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT DISTINCT ?person ?personLabel ?amount ?unit ?unitLabel ?convAmount ?convUnit ?convUnitLabel ?netWorthUSD WHERE {
  ?person wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?stmt .
  ?stmt psv:P2218 ?valNode .
  ?valNode wikibase:quantityAmount ?amount .
  OPTIONAL {
    ?valNode wikibase:quantityUnit ?unit .
  }
  OPTIONAL {
    ?stmt pq:P2442 ?convNode .
    ?convNode wikibase:quantityAmount ?convAmount .
    OPTIONAL {
      ?convNode wikibase:quantityUnit ?convUnit .
    }
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( lang( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?unit rdfs:label ?unitLabel FILTER ( lang( ?unitLabel ) = "en" )
  }
  OPTIONAL {
    ?convUnit rdfs:label ?convUnitLabel FILTER ( lang( ?convUnitLabel ) = "en" )
  }
  FILTER ( ( bound( ?unit ) && ?unit = wd:Q4917 && xsd:decimal ( ?amount ) >= 1000000000 ) || ( bound( ?convUnit ) && ?convUnit = wd:Q4917 && xsd:decimal ( ?convAmount ) >= 1000000000 ) ) BIND( IF( bound( ?unit ) && ?unit = wd:Q4917 , xsd:decimal ( ?amount ) , xsd:decimal ( ?convAmount ) ) AS ?netWorthUSD )
}
ORDER BY DESC ( ?netWorthUSD )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?numPartners ?femaleCount ?maleCount WHERE {
  {
    VALUES ( ?numPartners ?femaleCount ?maleCount ) {
      ( 0 380075 737989 )
    }
  } UNION {
    SELECT ?numPartners ( SUM( IF( ?sex = wd:Q6581072 , 1 , 0 ) ) AS ?femaleCount ) ( SUM( IF( ?sex = wd:Q6581097 , 1 , 0 ) ) AS ?maleCount ) WHERE {
      {
        SELECT ?person ?sex ( COUNT( DISTINCT ?partner ) AS ?numPartners ) WHERE {
          ?person wdt:P31 wd:Q5 .
          ?person wdt:P106 ?occ .
          ?occ wdt:P279 * wd:Q108289408 .
          ?person wdt:P21 ?sex .
          OPTIONAL {
            ?person wdt:P451 ?partner .
          }
        }
        GROUP BY ?person ?sex
      }
    }
    GROUP BY ?numPartners
    HAVING ( ?numPartners > 0 )
  }
}
ORDER BY ?numPartners

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?stmt ?version ?publicationDate WHERE {
  wd:Q83 p:P348 ?stmt .
  ?stmt ps:P348 ?version .
  OPTIONAL {
    ?stmt pq:P577 ?publicationDate .
  }
}
ORDER BY ?publicationDate ?version

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?lighthouse ?lighthouseLabel ?coord ?color ?colorLabel ?water ?waterLabel WHERE {
  ?lighthouse wdt:P31 wd:Q39715 ; wdt:P131 wd:Q504676 .
  OPTIONAL {
    ?lighthouse wdt:P462 ?color .
  }
  OPTIONAL {
    ?lighthouse wdt:P206 ?water .
  }
  OPTIONAL {
    ?lighthouse wdt:P625 ?coord .
  }
  OPTIONAL {
    ?lighthouse rdfs:label ?lighthouseLabel FILTER ( LANG( ?lighthouseLabel ) = "en" || LANG( ?lighthouseLabel ) = "sv" )
  }
  OPTIONAL {
    ?color rdfs:label ?colorLabel FILTER ( LANG( ?colorLabel ) = "en" || LANG( ?colorLabel ) = "sv" )
  }
  OPTIONAL {
    ?water rdfs:label ?waterLabel FILTER ( LANG( ?waterLabel ) = "en" || LANG( ?waterLabel ) = "sv" )
  }
}
ORDER BY ?lighthouseLabel

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT ?goat ?label ?image ?start ?end ?endOrNow WHERE {
  ?goat p:P2868 ?stmt .
  ?stmt ps:P2868 wd:Q151345 .
  OPTIONAL {
    ?stmt pq:P580 ?start .
  }
  OPTIONAL {
    ?stmt pq:P582 ?end .
  }
  OPTIONAL {
    ?goat wdt:P18 ?image .
  }
  OPTIONAL {
    ?goat rdfs:label ?labelEn FILTER ( LANG( ?labelEn ) = "en" )
  }
  OPTIONAL {
    ?goat rdfs:label ?labelDe FILTER ( LANG( ?labelDe ) = "de" )
  }
  OPTIONAL {
    ?goat rdfs:label ?labelNoLang FILTER ( LANG( ?labelNoLang ) = "" )
  }
  BIND( COALESCE ( ?labelEn , ?labelDe , ?labelNoLang ) AS ?label ) BIND( COALESCE ( ?end , NOW () ) AS ?endOrNow )
}
ORDER BY ?start ?goat

PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?mountain ?mountainLabel ( MAX( ?elevation ) AS ?maxElev ) WHERE {
  VALUES ?type {
    wd:Q8502 wd:Q207326
  }
  ?mountain wdt:P31 / wdt:P279 * ?type .
  ?mountain p:P2044 ?ps .
  ?ps psv:P2044 ?val .
  ?val wikibase:quantityAmount ?elevation .
  ?val wikibase:quantityUnit wd:Q11573 .
  FILTER NOT EXISTS {
    ?mountain wdt:P376 ?astronomicalBody
  }
  OPTIONAL {
    ?mountain rdfs:label ?mountainLabel FILTER ( lang( ?mountainLabel ) = "en" )
  }
}
GROUP BY ?mountain ?mountainLabel
HAVING ( MAX( ?elevation ) > 8000 )
ORDER BY DESC ( ?maxElev )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?event ?eventLabel ?tournament ?tournamentLabel WHERE {
  ?event wdt:P31 wd:Q46190676 ; wdt:P2094 wd:Q16893072 ; wdt:P361 ?tournament .
  ?tournament wdt:P361 + ?tour .
  FILTER ( ?tour = wd:Q300008 || ?tour = wd:Q3775082 ) FILTER NOT EXISTS {
    ?event wdt:P1346 ?winner
  }
  OPTIONAL {
    ?event rdfs:label ?eventLabel .
    FILTER ( LANG( ?eventLabel ) = "en" )
  }
  OPTIONAL {
    ?tournament rdfs:label ?tournamentLabel .
    FILTER ( LANG( ?tournamentLabel ) = "en" )
  }
}
ORDER BY ?tournament ?event

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?institution ( COUNT( DISTINCT ?thesis ) AS ?count ) ?institutionLabel WHERE {
  ?thesis wdt:P4101 ?institution .
  ?thesis wdt:P31 ?class .
  ?class wdt:P279 * wd:Q1266946 .
  OPTIONAL {
    ?institution rdfs:label ?institutionLabel FILTER ( LANG( ?institutionLabel ) = "en" )
  }
}
GROUP BY ?institution ?institutionLabel
ORDER BY DESC ( ?count )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?deathDate ?fsid ?father WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P27 wd:Q16 ; wdt:P570 ?deathDate ; wdt:P2889 ?fsid ; wdt:P22 ?father .
  FILTER NOT EXISTS {
    ?father wdt:P2889 ?fatherFSID
  }
}
ORDER BY ?person
LIMIT 1000

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?work ?workLabel ?type ?typeLabel WHERE {
  {
    ?work wdt:P50 wd:Q35610 .
  } UNION {
    ?edition wdt:P50 wd:Q35610 ; wdt:P629 ?work .
  }
  OPTIONAL {
    ?work wdt:P31 ?type .
    OPTIONAL {
      ?type rdfs:label ?typeLabel FILTER ( LANG( ?typeLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?work rdfs:label ?workLabel FILTER ( LANG( ?workLabel ) = "en" )
  }
}
ORDER BY ?workLabel
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?state ?stateLabel ?coord ?officialLanguage ?officialLanguageLabel WHERE {
  ?state wdt:P31 wd:Q3624078 .
  OPTIONAL {
    ?state wdt:P625 ?coord .
  }
  OPTIONAL {
    ?state wdt:P37 ?officialLanguage .
  }
  OPTIONAL {
    ?state rdfs:label ?stateLabel .
    FILTER ( LANG( ?stateLabel ) = "en" )
  }
  OPTIONAL {
    ?officialLanguage rdfs:label ?officialLanguageLabel .
    FILTER ( LANG( ?officialLanguageLabel ) = "en" )
  }
}
