PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel ?year ?inception ?commemorates ?commemoratesLabel ?image ?coordinates WHERE {
  ?item wdt:P131 * wd:Q1757 .
  {
    ?item wdt:P1435 ?designation .
  } UNION {
    ?item wdt:P31 ?class .
    ?class wdt:P279 * wd:Q210272 .
  } UNION {
    ?item wdt:P31 ?class2 .
    ?class2 wdt:P279 * wd:Q811165 .
  }
  OPTIONAL {
    ?item wdt:P571 ?inception .
    BIND( YEAR( ?inception ) AS ?year )
  }
  OPTIONAL {
    ?item wdt:P547 ?commemorates .
    OPTIONAL {
      ?commemorates rdfs:label ?commemoratesLabel FILTER ( LANG( ?commemoratesLabel ) = "en" )
    }
  }
  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  OPTIONAL {
    ?item wdt:P625 ?coordinates .
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?item

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?person ?personLabel WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q10833314 ; wdt:P27 wd:Q31 .
  FILTER NOT EXISTS {
    ?person wdt:P27 ?otherCit .
    FILTER ( ?otherCit != wd:Q31 )
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
}
ORDER BY ?personLabel

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT DISTINCT ?country ?pand ?pandLabel ?death ?date WHERE {
  BIND( wd:Q38 AS ?country ) ?pand p:P1120 ?stmt .
  ?stmt ps:P1120 ?death .
  OPTIONAL {
    ?stmt pq:P585 ?date
  }
  ?pand rdfs:label ?pandLabel .
  FILTER ( LANG( ?pandLabel ) = "en" ) FILTER ( CONTAINS( LCASE( ?pandLabel ) , "covid" ) || CONTAINS( LCASE( ?pandLabel ) , "coronavirus" ) ) FILTER ( ?pand = wd:Q84104992 || EXISTS {
    ?pand wdt:P17 wd:Q38
  }
  )
}
ORDER BY ?date
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?type ( SAMPLE( ?lbl ) AS ?typeLabel ) ( COUNT( DISTINCT ?org ) AS ?count ) WHERE {
  ?org wdt:P31 ?type .
  ?type wdt:P279 * wd:Q43229 .
  VALUES ?locProp {
    wdt:P131 wdt:P159 wdt:P276
  }
  ?org ?locProp ?loc .
  {
    ?loc wdt:P131 * wd:Q5765 .
  } UNION {
    FILTER ( ?loc = wd:Q5765 )
  }
  OPTIONAL {
    ?type rdfs:label ?lbl .
    FILTER ( LANG( ?lbl ) = "en" )
  }
}
GROUP BY ?type
ORDER BY DESC ( ?count )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?item ?itemLabel WHERE {
  ?item wdt:P279 * wd:Q87167 .
  FILTER ( ?item != wd:Q87167 ) OPTIONAL {
    ?item rdfs:label ?itemLabel FILTER ( LANG( ?itemLabel ) = "en" )
  }
}
ORDER BY ?itemLabel

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?property ?propertyLabel ?value ?valueLabel WHERE {
  wd:Q9696 ?property ?value .
  FILTER ( STRSTARTS( STR( ?property ) , "http://www.wikidata.org/prop/direct/" ) ) .
  OPTIONAL {
    ?property rdfs:label ?propertyLabel .
    FILTER ( LANG( ?propertyLabel ) = "en" )
  }
  OPTIONAL {
    ?value rdfs:label ?valueLabel .
    FILTER ( LANG( ?valueLabel ) = "en" )
  }
}
ORDER BY STR( ?property ) ?valueLabel

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?category ?label_fr ?count WHERE {
  {
    SELECT ?category ?label_fr ( COUNT( DISTINCT ?unit ) AS ?count ) WHERE {
      ?category wdt:P361 wd:Q112176282 .
      OPTIONAL {
        ?category rdfs:label ?label_fr FILTER ( lang( ?label_fr ) = "fr" )
      }
      ?unit wdt:P1454 ?category .
      {
        ?unit wdt:P17 wd:Q142
      } UNION {
        ?unit wdt:P495 wd:Q142
      } UNION {
        ?unit wdt:P159 ?loc .
        ?loc wdt:P17 wd:Q142
      }
    }
    GROUP BY ?category ?label_fr
    HAVING ( COUNT( DISTINCT ?unit ) > 499 )
  } UNION {
    SELECT ( "AUTRES" AS ?label_fr ) ( SUM( ?c ) AS ?count ) ( "" as ?category ) WHERE {
      SELECT ( COUNT( DISTINCT ?unit ) AS ?c ) WHERE {
        ?category wdt:P361 wd:Q112176282 .
        ?unit wdt:P1454 ?category .
        {
          ?unit wdt:P17 wd:Q142
        } UNION {
          ?unit wdt:P495 wd:Q142
        } UNION {
          ?unit wdt:P159 ?loc .
          ?loc wdt:P17 wd:Q142
        }
      }
      GROUP BY ?category
      HAVING ( ?c <= 499 )
    }
  }
}
ORDER BY DESC ( ?count )

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?place ?placeLabel ?coord ?center ( geof:distance ( ?coord , ?center ) AS ?distance ) WHERE {
  wd:Q2180733 wdt:P625 ?meznoCoord .
  BIND( ?meznoCoord AS ?center ) .
  ?place wdt:P17 wd:Q213 ; wdt:P625 ?coord ; wdt:P31 ?type .
  VALUES ?type {
    wd:Q532 wd:Q3957
  }
  FILTER ( geof:distance ( ?coord , ?center ) <= 35 ) OPTIONAL {
    ?place rdfs:label ?placeLabel FILTER ( LANG( ?placeLabel ) = "en" )
  }
}
ORDER BY ?distance
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?periodical ?labelEn ?labelEo WHERE {
  ?periodical wdt:P31 / wdt:P279 * wd:Q1002697 .
  ?periodical wdt:P407 wd:Q143 .
  OPTIONAL {
    ?periodical rdfs:label ?labelEn FILTER ( LANG( ?labelEn ) = "en" )
  }
  OPTIONAL {
    ?periodical rdfs:label ?labelEo FILTER ( LANG( ?labelEo ) = "eo" )
  }
}
ORDER BY ?labelEn ?labelEo

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?city ( SAMPLE( ?lab ) AS ?cityLabel ) ( SAMPLE( ?coord0 ) AS ?coord ) ( MAX( ?pop ) AS ?population ) WHERE {
  ?city wdt:P31 / wdt:P279 * wd:Q515 ; wdt:P17 wd:Q159 .
  ?city wdt:P1082 ?pop .
  OPTIONAL {
    ?city wdt:P625 ?coord0 .
  }
  OPTIONAL {
    ?city rdfs:label ?lab .
    FILTER ( LANG( ?lab ) = "en" )
  }
}
GROUP BY ?city
HAVING ( MAX( ?pop ) > 100000 )
ORDER BY DESC ( ?population )
LIMIT 500

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?item ?itemLabel_ja ?itemLabel_en ?volume ?seriesOrdinal ?pubDate ?place ?placeLabel WHERE {
  ?item wdt:P31 / wdt:P279 * wd:Q53460949 .
  ?item ?partProp wd:Q3853685 .
  FILTER ( ?partProp IN ( wdt:P179 , wdt:P361 ) ) OPTIONAL {
    ?item rdfs:label ?itemLabel_ja FILTER ( LANG( ?itemLabel_ja ) = "ja" )
  }
  OPTIONAL {
    ?item rdfs:label ?itemLabel_en FILTER ( LANG( ?itemLabel_en ) = "en" )
  }
  OPTIONAL {
    ?item wdt:P478 ?volume
  }
  OPTIONAL {
    ?item wdt:P1545 ?seriesOrdinal
  }
  OPTIONAL {
    ?item wdt:P577 ?pubDate
  }
  OPTIONAL {
    ?item wdt:P291 ?place .
    ?place rdfs:label ?placeLabel
    FILTER ( LANG( ?placeLabel ) = "en" )
  }
}
ORDER BY ?pubDate ?item

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?country ?countryLabel ?flag ?population WHERE {
  ?country wdt:P31 wd:Q6256 .
  OPTIONAL {
    ?country wdt:P41 ?flag .
  }
  OPTIONAL {
    ?country wdt:P1082 ?population .
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
