PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?author ?authorLabel ?place ?placeLabel ?dob WHERE {
  ?author wdt:P31 wd:Q5 .
  ?author wdt:P27 wd:Q30 .
  ?author wdt:P19 ?place .
  ?place ( wdt:P131 ) * wd:Q771 .
  ?author wdt:P569 ?dob .
  OPTIONAL {
    ?author wdt:P570 ?dod
  }
  FILTER ( ! BOUND( ?dod ) ) FILTER ( ?dob > "1919-12-31T00:00:00Z" ^^ xsd:dateTime ) ?author wdt:P106 ?occ .
  FILTER ( ?occ = wd:Q482980 || ?occ = wd:Q36180 || EXISTS {
    ?occ ( wdt:P279 ) * wd:Q36180
  }
  ) OPTIONAL {
    ?author rdfs:label ?authorLabel FILTER ( LANG( ?authorLabel ) = "en" )
  }
  OPTIONAL {
    ?place rdfs:label ?placeLabel FILTER ( LANG( ?placeLabel ) = "en" )
  }
}
ORDER BY ?dob
LIMIT 5000

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?article ?label ?labelLang ?doi ?date ?author WHERE {
  ?article wdt:P1433 wd:Q15817086 .
  FILTER NOT EXISTS {
    ?article rdfs:label ?elab .
    FILTER ( LANG( ?elab ) = "en" )
  }
  OPTIONAL {
    ?article rdfs:label ?label .
    BIND( LANG( ?label ) AS ?labelLang ) FILTER ( ?labelLang != "en" )
  }
  OPTIONAL {
    ?article wdt:P356 ?doi
  }
  OPTIONAL {
    ?article wdt:P577 ?date
  }
  OPTIONAL {
    ?article wdt:P50 ?author
  }
}
LIMIT 1000

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?unit ?unitLabel ?part ?partLabel ?partOf ?partOfLabel ?geolex WHERE {
  ?unit wdt:P31 / wdt:P279 * wd:Q3550897 .
  {
    ?unit wdt:P131 wd:Q816 .
  } UNION {
    ?unit wdt:P131 ?place .
    ?place wdt:P131 * wd:Q816 .
  }
  OPTIONAL {
