PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?race ?raceLabel ?eventTime ?sumAges WHERE {
  ?race wdt:P361 wd:Q41174436 .
  OPTIONAL {
    ?race wdt:P580 ?startTime .
  }
  OPTIONAL {
    ?race wdt:P585 ?pointTime .
  }
  BIND( COALESCE ( ?startTime , ?pointTime ) AS ?eventTime ) .
  OPTIONAL {
    ?race rdfs:label ?raceLabel FILTER ( LANG( ?raceLabel ) = "en" )
  }
  OPTIONAL {
    SELECT ?race ( SUM( ?age ) AS ?sumAges ) WHERE {
      ?race p:P2321 ?stmt .
      ?stmt ps:P2321 ?driver .
      ?stmt pq:P1352 ?pos .
      FILTER ( ?pos IN ( 1 , 2 , 3 ) ) .
      ?driver wdt:P569 ?dob .
      OPTIONAL {
        ?race wdt:P580 ?startTime2 .
      }
      OPTIONAL {
        ?race wdt:P585 ?pointTime2 .
      }
      BIND( COALESCE ( ?startTime2 , ?pointTime2 ) AS ?eventTime2 ) .
      BIND( ( YEAR( ?eventTime2 ) - YEAR( ?dob ) ) AS ?age0 ) .
      BIND( IF( ( ( MONTH( ?eventTime2 ) > MONTH( ?dob ) ) || ( ( MONTH( ?eventTime2 ) = MONTH( ?dob ) ) && ( DAY( ?eventTime2 ) >= DAY( ?dob ) ) ) ) , 0 , 1 ) AS ?minus ) .
      BIND( ( ?age0 - ?minus ) AS ?age ) .
    }
    GROUP BY ?race
  }
}
ORDER BY ?eventTime

