SELECT DISTINCT ?person ?personLabel ?position ?employer ?employerLabel ?coords ?start ?startYear ?end ?endYear ?tenureMonths WHERE {
  ?person p:P39 ?statement .
  ?statement ps:P39 wd:Q3809586 .
  BIND( wd:Q3809586 AS ?position ) OPTIONAL {
    ?statement pq:P108 ?employer .
  }
  OPTIONAL {
    ?person wdt:P108 ?employer .
  }
  OPTIONAL {
    ?employer wdt:P625 ?coords .
  }
  OPTIONAL {
    ?statement pq:P580 ?start .
    BIND( YEAR( ?start ) AS ?startYear )
  }
  OPTIONAL {
    ?statement pq:P582 ?end .
    BIND( YEAR( ?end ) AS ?endYear )
  }
  OPTIONAL {
    ?statement pq:P580 ?s .
    ?statement pq:P582 ?e .
    BIND( ( ( YEAR( ?e ) - YEAR( ?s ) ) * 12 + ( MONTH( ?e ) - MONTH( ?s ) ) ) AS ?tenureMonths )
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?employer rdfs:label ?employerLabel .
    FILTER ( LANG( ?employerLabel ) = "en" )
  }
}
ORDER BY ?personLabel

