  OPTIONAL { ?test wdt:P585 ?date. }

  # optional operator
  OPTIONAL { ?test wdt:P137 ?operator.
             OPTIONAL { ?operator rdfs:label ?operatorLabel FILTER(LANG(?operatorLabel) = "en") } }

  # explosive energy equivalent: the raw statement value (ps:P2145) and the normalized quantity (psv:P2145)
  OPTIONAL {
    ?test p:P2145 ?yieldStmt .
    ?yieldStmt ps:P2145 ?psYield .
    OPTIONAL {
      ?yieldStmt psv:P2145 ?psvVal .
      ?psvVal wikibase:quantityAmount ?psvAmount .
