SELECT ?award ?awardLabel ( COUNT( DISTINCT ?person ) AS ?total ) ( SUM( ?isBefore ) AS ?before ) ( SUM( ?isAfter ) AS ?after ) ( SUM( ?isSame ) AS ?same ) ( SUM( ?isUnknown ) AS ?unknown ) WHERE {
  {
    SELECT ?person ?award ( MIN( ?awardTime0 ) AS ?awardTime ) ( MIN( ?leibnizTime0 ) AS ?leibnizTime ) WHERE {
      ?person wdt:P166 wd:Q703205 .
      ?person p:P166 ?leibStmt .
