      FILTER ( ?award != wd:Q703205 ) OPTIONAL {
        ?awStmt pq:P585 ?awardTime0 .
      }
      ?award ( wdt:P31 | wdt:P279 * ) ?atype .
      VALUES ?atype {
        wd:Q618779 wd:Q11448906 wd:Q15383322 wd:Q107471279 wd:Q378427 wd:Q107494520 wd:Q1966910 wd:Q1709894
      }
    }
    GROUP BY ?person ?award
  }
  BIND( IF( BOUND( ?awardTime ) && BOUND( ?leibnizTime ) , IF( ?awardTime < ?leibnizTime , "before" , IF( ?awardTime > ?leibnizTime , "after" , "same" ) ) , "unknown" ) AS ?relation ) BIND( IF( ?relation = "before" , 1 , 0 ) AS ?isBefore ) BIND( IF( ?relation = "after" , 1 , 0 ) AS ?isAfter ) BIND( IF( ?relation = "same" , 1 , 0 ) AS ?isSame ) BIND( IF( ?relation = "unknown" , 1 , 0 ) AS ?isUnknown ) OPTIONAL {
