SELECT ?municipality ?municipalityLabel ?idescat ?population ?populationTime ?area ?coat WHERE {
  ?municipality wdt:P4335 ?idescat .
  ?municipality wdt:P131 + wd:Q5705 .
  ?municipality wdt:P31 / wdt:P279 * wd:Q15284 .
  FILTER ( STRSTARTS( STR( ?idescat ) , "25" ) ) OPTIONAL {
