  }
  OPTIONAL {
    ?municipality wdt:P2046 ?area
  }
  OPTIONAL {
    ?municipality wdt:P94 ?coat
  }
  {
    SELECT ?municipality ( MAX( ?key ) AS ?best ) WHERE {
      ?municipality p:P1082 ?popStmt .
      ?popStmt ps:P1082 ?popVal .
      OPTIONAL {
        ?popStmt pq:P585 ?popTime .
      }
      OPTIONAL {
        ?popStmt wikibase:rank ?rank .
