    }
    GROUP BY ?municipality
  }
  BIND( STRAFTER( ?best , "|" ) AS ?after1 ) BIND( STRAFTER( ?after1 , "|" ) AS ?population ) BIND( STRBEFORE( ?after1 , "|" ) AS ?populationTime )
